import React, {useState, useEffect} from 'react';
import './App.css';

function App() {

  const [data, setData] = useState([{}])

  useEffect(() => {
    fetch("/api/tasks")
    .then(res => res.json())
    .then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  return (
    <div className="App">
      <h2>To Do List</h2>
      <button class="btn">Press me :)</button>
    </div>
  );
}

export default App;
